        function = str(counter)
        for c in c_str:
            function += c
        function = int(function)
        function = function ** 2
        if function <= n and is_palindrome(function):
            ret += 1

        function = str(counter)
        for c in c_str[1:]:
            function += c
        function = int(function)
        function = function ** 2
        if function <= n and is_palindrome(function):
            ret += 1

        counter += 1

    return ret

def is_palindrome(n):
    if n == 0:
        return False
    num = str(n)
    check_len = len(num) / 2
    ret = True
    for i in range(check_len):
        ret &= num[i] == num[-i - 1]
    return ret

 R = get_number_of_test_case()
t = 1
while t <=  R:
    solve_case(t)
    t += 1
